/*
You need to write a program which prints out prime numbers up to some limit 'N'.


To do this your program must first take an input 't' which denotes how many
test cases the program needs to run. For the next 't' lines it must take a
number 'N' as input and print out the first 'N' prime numbers in that line.

For example an input of:

4
5
4
0
7

should produce an output of:

2 3 5 7 11
2 3 5 7

2 3 5 7 11 13 17


In our example, the first number given as input (which is 4) is the number of
test cases 't'. The following 4 lines contain 'N', respectively 5, 4, 0, 7.
Corresponding to the 'N' numbers we print out the first 'N' (5) prime numbers '2 3 5 7
11', then the first 4 prime numbers '2 3 5 7'. For zero we simply print a blank
line and finally the first 7 prime numbers '2 3 5 7 11 13 17'.

Take care that no extra things are printed otherwise the solution will be rejected.
*/
#include <stdio.h>
int main()
{   int t,num[1000],largest=0,nf,prime[100];//t=no of testcase,num=number,nf=no of factors,prime[]=array to store prime nos
    int i,j,k=0;
    scanf("%d",&t);
    for(i=0;i<t;i++)
    {   scanf("%d",&num[i]);
        if(largest<num[i])
            largest=num[i];
    }
    for(i=2;k<largest;i++)
    {   nf=0;
        for(j=2;j<=i/2;j++)
        {   if(i%j==0)
            {   nf++;
                break;
            }
        }
        if(nf==0)
            prime[k++]=i;
    }
    for(i=0;i<t;i++)
    {   for(j=0;j<num[i];j++)
            printf("%d ",prime[j]);
        printf("\n");
    }
    return 0;
}
